import './App.css';
import React from 'react';
import BOOK_LIST from './store/books.json'
import {Book} from './components/Book'

const App = () => {
  console.log()
  return (
    <>
      {BOOK_LIST.map((book) => {
        return <Book key={book.id} title={book.title}/>
      })}
    </>
  );
}

export default App;
